import React from 'react';
import '../styles/Login.css';


const Login = () => {
    return (
        <section>
            <div className="form-box">
                <h2>Login</h2>

                <div className="register">
                    <p>Don't have a account <a href="http://127.0.0.1:8000/signup">Register</a></p>
                </div>
            </div>
        </section>
    );
};

export default Login;
